import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class AuthService {
  url: string = 'http://localhost:8080/api/room';

  constructor(private httpclient: HttpClient) {}

  getRoomDetails() {
    return this.httpclient.get(this.url);
  }
}
